import { CUSTOM_ELEMENTS_SCHEMA, NgModule, NO_ERRORS_SCHEMA } from '@angular/core';
import { CommonModule } from '@angular/common';

import { AdminRoutingModule } from './admin-routing.module';
import { AdminComponent } from './admin.component';
import { DashboardComponent } from './dashboard/dashboard.component';
import { AdminHeaderComponent } from './component/admin-header/admin-header.component';
import { SearchComponent } from './search/search.component';
import { DeliveryTripComponent } from './delivery-trip/delivery-trip.component';
import { StampDocumentationComponent } from './stamp-documentation/stamp-documentation.component';
import { CouriersComponent } from './couriers/couriers.component';
import { CustomersComponent } from './customers/customers.component';
import { B2bTripsComponent } from './b2b-trips/b2b-trips.component';
import { B2bCustomersComponent } from './b2b-customers/b2b-customers.component';
import { PayoutComponent } from './payout/payout.component';
import { TripDetailsComponent } from './trip-details/trip-details.component';
import { CourierViewComponent } from './courier-view/courier-view.component';
import { CourierPayoutComponent } from './courier-payout/courier-payout.component';
import { SettingComponent } from './setting/setting.component';
import { CustomersViewComponent } from './customers-view/customers-view.component';
import { CouriersPayoutViewComponent } from './couriers-payout-view/couriers-payout-view.component';


import {MaterialExampleModule} from '../material.module';
import {app-dashboard} from './dashboard/dashboard.component';
import {FormsModule, ReactiveFormsModule} from '@angular/forms';
import {MatNativeDateModule} from '@angular/material/core';
import {HttpClientModule} from '@angular/common/http';


@NgModule({
  declarations: [
    AdminComponent,
    DashboardComponent,
    AdminHeaderComponent,
    SearchComponent,
    DeliveryTripComponent,
    StampDocumentationComponent,
    CouriersComponent,
    CustomersComponent,
    B2bTripsComponent,
    B2bCustomersComponent,
    PayoutComponent,
    TripDetailsComponent,
    CourierViewComponent,
    CourierPayoutComponent,
    SettingComponent,
    CustomersViewComponent,
    CouriersPayoutViewComponent,



  ],
  imports: [
    CommonModule,
    AdminRoutingModule,
    FormsModule,
    MaterialExampleModule,CardOverviewExample,ReactiveFormsModule,MatNativeDateModule,HttpClientModule
  ],
  schemas:[CUSTOM_ELEMENTS_SCHEMA,
    NO_ERRORS_SCHEMA]
})
export class AdminModule { }
